import { useState } from "react";
import axios from "axios";
import { Link } from "react-router-dom";

const Signup = () => {
  const [data, setData] = useState({
    firstName: "",
    lastName: "",
    email: "",
    password: "",
  });
  const [error, setError] = useState("");
  const [msg, setMsg] = useState("");

  const handleChange = ({ currentTarget: input }) => {
    setData({ ...data, [input.name]: input.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const url = "http://localhost:8080/api/users";
      const { data: res } = await axios.post(url, data);
      setMsg(res.message);
    } catch (error) {
      if (error.response && error.response.status >= 400 && error.response.status <= 500) {
        setError(error.response.data.message);
      }
    }
  };

  return (
    <div className="min-h-screen bg-cover bg-center relative" style={{ backgroundImage: "url('https://images.unsplash.com/photo-1593642532973-d31b6557fa68')" }}>
      <div className="absolute inset-0 bg-gradient-to-b from-black via-transparent to-black opacity-70"></div>
      <div className="flex justify-center items-center min-h-screen px-6">
        <div className="bg-gray-800 bg-opacity-85 p-10 rounded-3xl shadow-xl max-w-lg w-full">
          <div className="text-center mb-8">
            <h1 className="text-5xl text-transparent bg-clip-text bg-gradient-to-r from-purple-500 via-indigo-500 to-pink-500 font-extrabold mb-4">Join the Adventure</h1>
            <p className="text-xl text-gray-300 mb-6">Create a new account and start your journey</p>
            <Link to="/login">
              <button className="px-6 py-2 text-lg text-white bg-gradient-to-r from-indigo-500 via-purple-600 to-pink-500 rounded-md hover:bg-gradient-to-l hover:from-indigo-400 hover:to-pink-400 transition-all duration-300 ease-in-out">
                Already have an account? Log In
              </button>
            </Link>
          </div>
          <form onSubmit={handleSubmit} className="space-y-6">
            <h2 className="text-4xl text-white font-semibold text-center mb-6">Create Account</h2>
            <div className="relative">
              <input
                type="text"
                name="firstName"
                placeholder="First Name"
                onChange={handleChange}
                value={data.firstName}
                className="w-full px-4 py-3 rounded-lg text-white bg-gray-700 placeholder-gray-500 focus:outline-none focus:ring-4 focus:ring-pink-400 transition-all ease-in-out"
                required
              />
            </div>
            <div className="relative">
              <input
                type="text"
                name="lastName"
                placeholder="Last Name"
                onChange={handleChange}
                value={data.lastName}
                className="w-full px-4 py-3 rounded-lg text-white bg-gray-700 placeholder-gray-500 focus:outline-none focus:ring-4 focus:ring-pink-400 transition-all ease-in-out"
                required
              />
            </div>
            <div className="relative">
              <input
                type="email"
                name="email"
                placeholder="Email"
                onChange={handleChange}
                value={data.email}
                className="w-full px-4 py-3 rounded-lg text-white bg-gray-700 placeholder-gray-500 focus:outline-none focus:ring-4 focus:ring-pink-400 transition-all ease-in-out"
                required
              />
            </div>
            <div className="relative">
              <input
                type="password"
                name="password"
                placeholder="Password"
                onChange={handleChange}
                value={data.password}
                className="w-full px-4 py-3 rounded-lg text-white bg-gray-700 placeholder-gray-500 focus:outline-none focus:ring-4 focus:ring-pink-400 transition-all ease-in-out"
                required
              />
            </div>
            {error && <div className="text-red-600 text-sm">{error}</div>}
            {msg && <div className="text-green-600 text-sm">{msg}</div>}
            <button
              type="submit"
              className="w-full py-3 bg-gradient-to-r from-pink-500 via-purple-500 to-indigo-500 text-white font-semibold rounded-lg hover:opacity-90 transition-all duration-200 ease-in-out"
            >
              Sign Up
            </button>
          </form>
        </div>
      </div>
    </div>
  );
};

export default Signup;
